import { Box } from "@mui/material";
import Header from "./pages/Header";
import Navbar from "./pages/Navbar";

function App() {
  return (
    <>
      <Box sx={{ height: "100vh" }}>
        <Navbar />
        <Header />
      </Box>
    </>
  );
}

export default App;
